import {convertTemperature} from '../businessLogic/WeatherBusinessLogic';
import Dropdown from 'react-bootstrap/Dropdown'

export const temperatureDropdownList =(temperatureUnitsFrom, changeTemperatureUnitsState) => {
    return (
    <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic">a
        Temperature units converter
        </Dropdown.Toggle>

        <Dropdown.Menu onSelect= {(event) =>  {console.log("value: " + event.target.value);
        changeTemperatureUnitsState(temperatureUnitsFrom, event.target.value);} }>
            <Dropdown.Item>Kelvin</Dropdown.Item>
            <Dropdown.Item>Celsius</Dropdown.Item>
            <Dropdown.Item>Fahrenheit</Dropdown.Item>
        </Dropdown.Menu>
    </Dropdown>
    )
}
